INSERT INTO termin (_id, dozent, tag, begin, ende, typ, start_datum, end_datum, hinweis, gehoert_zu_gr, gehalten_in)VALUES(1984, 'Jeberien', 2, 0945, 1715, 1, '20170424', '20170619', '', 2451, 'WHA403');
INSERT INTO termin (_id, dozent, tag, begin, ende, typ, start_datum, end_datum, hinweis, gehoert_zu_gr, gehalten_in)VALUES(1985, 'null', 2, 1400, 1530, 3, '20170410', '20170729', 'Dozent: Zaman Penan’s Oroo’ Short Message Signs (PO-SMS) Mobile Application The Penan community is one of the small indigenous populations living in the rainforest of Malaysian Borneo. The Penan are known as the prodigies of jungle travel and rainforest sign language. They often traveled in smaller groups, with the leading group leaving behind messages for the following groups. These messages/signs are called Oroo’. Oroo’ is a living cultural heritage that is of extreme value to the Penan society, from a social, historical, political and scientific perspective. However, it is at the virtue of extinction with recent changes in lifestyle. The youth inhabiting the rainforest are more drawn to technology than traditional forest activities needing cognizance of Oroo’. In 2013, with community partnership and as part of a long-term collaboration, we launched Oroo’ sign language revitalization project. Complementing previous efforts of digitalization, we recently embarked on the co-designing of the Penan’s Oroo’ Short Message Signs (PO-SMS) application, which will extends current technology driven communication means. Following a community-based co-design approach, a group of local youth and elders have led the unique paper prototype of their own digital indigenous communication tool. This project work requires students to apply knowledge and skills and develop PO-SMS mobile application based on community co-designed paper prototype. For further reference and background students can refer to following resources; Research Publications For PO-SMS Zaman, T. & Winschier-Theophilus, H. (2015) Penan’s Oroo Short Message Signs (PO-SMS): Co-design of A Digital Jungle Sign Language Application, Human-Computer Interaction–INTERACT 2015, Bamberg Germany For previous Oroo’ digitalization project Zaman, T., Winschier-Theophilus, H., Yeo, A.W., Ting, L. C., Jengan, G. (2015). Reviving an indigenous rainforest sign language: Digital Oroo’ Adventure Game. Paper presented at Proceedings of the International Conference on Information and Communication Technologies and Development, 15-18 May, 2015, Nanyang Technological University, Singapore (Indexed in ACM Digital Library) Plimmer, B., He, L., Zaman, T., Karunanayaka, K., Yeo, A.W., Jengan, G., Blagojevic, R., Yi-Luen, E.D. (2015). New Interaction Tools For Preserving an Old Language. In: Conference 33rd Annual ACM conference on Human factors in Computing Systems (CHI) ACM, (2015) Youtube Video https://www.youtube.com/watch?v=8h0-_pDZUrI', 2452, 'WHC638');
INSERT INTO termin (_id, dozent, tag, begin, ende, typ, start_datum, end_datum, hinweis, gehoert_zu_gr, gehalten_in)VALUES(1986, 'Oßwald', 4, 1545, 1715, 3, '20170412', '20170729', 'Computermuseum -        vordringlich: Korrekturen am lfd. Verwaltungssystem des Computermuseums (Bildanzeige, Kalender implementieren), -        Suche nach Lösungen für die Datenmigration zur neuen Software-Version (. PHP-Kenntnisse sind dafür von großem Vorteil!), -        aktive Mithilfe für die Lange Nacht der Wissenschaften, -        auch eigene kreative Ideen zur Gestaltung und Umsetzung interaktiver Modelle sind gefragt.', 2453, 'WHC257');
